    import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

import Box from '@mui/material/Box';
import Tab from '@mui/material/Tab';
import TabContext from '@mui/lab/TabContext';
import TabList from '@mui/lab/TabList';
import TabPanel from '@mui/lab/TabPanel';

import PostAddIcon from '@mui/icons-material/PostAdd';
import StorageIcon from '@mui/icons-material/Storage';
import TurnSharpRightIcon from '@mui/icons-material/TurnSharpRight';
import DomainAddIcon from '@mui/icons-material/DomainAdd';
import DomainIcon from '@mui/icons-material/Domain';
import LogoutIcon from '@mui/icons-material/Logout';

function DashBoard(){

  const navigate = useNavigate();
  const [value, setValue] = useState('1');

  const logout = () => {
    localStorage.removeItem('access');
    localStorage.removeItem('refresh');
    navigate('/');
  };

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <div className=" bg-slate-200 min-h-screen text-black flex">
      <TabContext value={value}>
        <Box sx={{ display: 'flex', width: '100%' }}>
          
        
            <Box sx={{ borderRight: 1,borderColor: 'divider',display: 'flex',flexDirection: 'column',alignItems: 'center', backgroundColor: 'black',py: 2, width: 80,minHeight: '100vh',gap: 2, }} >
            
                <TabList orientation="vertical" onChange={handleChange} aria-label="Vertical icon tabs" sx={{ '& .MuiTab-root': { minWidth: 0, padding: '12px',color: 'white',}, '& .Mui-selected': {color: 'blue',},}}>
               
                    <Tab icon={<StorageIcon/>} value="1" />
                    <Tab icon={<PostAddIcon />} value="2" />
                    <Tab icon={<TurnSharpRightIcon />} value="3" />
                    <Tab icon={<DomainAddIcon />} value="4" />
                    <Tab icon={<DomainIcon />} value="5" />
                </TabList>

                <button onClick={logout} className="mt-auto mb-4 px-4 py-2 bg-red-600 rounded hover:bg-red-500"title="Logout"><LogoutIcon /></button>
          
            </Box>

       
          <Box sx={{ flexGrow: 1, p: 4 }}>
                <TabPanel value="1"></TabPanel>
                <TabPanel value="2">Item Two</TabPanel>
                <TabPanel value="3">Item Three</TabPanel>
                <TabPanel value="4">Item Four</TabPanel>
                <TabPanel value="5">Item Five</TabPanel>
          </Box>

        </Box>

      </TabContext>

    </div>
  );
}

export default DashBoard;
